import React from "react";
import './Card.css';

const Card = ({id,name,status,species,gender,origin,image,onClose}) => {

   return (
      <div className="card-container">
         <button onClick={() => onClose(id)}>X</button>
         <img src={image} alt={name} />
         <div>
            <h2>{name}</h2>
            <h2>{status}</h2>
            <h2>{species}</h2>
            <h2>{gender}</h2>
            <h2>{origin}</h2>
         </div>
      </div>
   );
}

export default Card;
